import React, { useEffect, useState } from "react";

export const Checkou = () => {
    const [cart, setCart] = useState([]);
    const [subtotal, setSubtotal] = useState(0);
    const [selectedPaymentMethod, setSelectedPaymentMethod] = useState("");

    // Load cart items from localStorage on component mount
    useEffect(() => {
        const storedCart = JSON.parse(localStorage.getItem("cart")) || [];
        setCart(storedCart);
    }, []);

    // Update subtotal whenever the cart changes
    useEffect(() => {
        const calculatedSubtotal = cart.reduce(
            (total, item) => total + item.price * item.quantity,
            0
        );
        setSubtotal(calculatedSubtotal);
    }, [cart]);

    // Handle payment method selection
    const handlePaymentChange = (event) => {
        setSelectedPaymentMethod(event.target.id);
    };

    // Handle form submission
    const handlePlaceOrder = (event) => {
        event.preventDefault();
        if (!selectedPaymentMethod) {
            alert("Please select a payment method to proceed.");
            return;
        }

        if (selectedPaymentMethod === "paypal") {
            console.log("Redirecting to PayPal...");
            // Integrate PayPal payment process here
        } else if (selectedPaymentMethod === "payment") {
            console.log("Processing check payment...");
        } else {
            console.log("Unknown payment method selected.");
        }
    };

    return (
        <section className="checkout spad">
            <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <h6>
                            <span className="icon_tag_alt" /> Have a coupon?{" "}
                            <a href="#">Click here</a> to enter your code
                        </h6>
                    </div>
                </div>
                <div className="checkout__form">
                    <h4>Billing Details</h4>
                    <form onSubmit={handlePlaceOrder}>
                        <div className="row">
                            <div className="col-lg-8 col-md-6">
                                <div className="row">
                                    <div className="col-lg-6">
                                        <div className="checkout__input">
                                            <p>First Name<span>*</span></p>
                                            <input type="text" required />
                                        </div>
                                    </div>
                                    <div className="col-lg-6">
                                        <div className="checkout__input">
                                            <p>Last Name<span>*</span></p>
                                            <input type="text" required />
                                        </div>
                                    </div>
                                </div>
                                <div className="checkout__input">
                                    <p>Country<span>*</span></p>
                                    <input type="text" required />
                                </div>
                                <div className="checkout__input">
                                    <p>Address<span>*</span></p>
                                    <input
                                        type="text"
                                        placeholder="Street Address"
                                        className="checkout__input__add"
                                        required
                                    />
                                    <input
                                        type="text"
                                        placeholder="Apartment, suite, unit, etc. (optional)"
                                    />
                                </div>
                                <div className="checkout__input">
                                    <p>Town/City<span>*</span></p>
                                    <input type="text" required />
                                </div>
                                <div className="checkout__input">
                                    <p>State<span>*</span></p>
                                    <input type="text" required />
                                </div>
                                <div className="checkout__input">
                                    <p>Postcode / ZIP<span>*</span></p>
                                    <input type="text" required />
                                </div>
                                <div className="row">
                                    <div className="col-lg-6">
                                        <div className="checkout__input">
                                            <p>Phone<span>*</span></p>
                                            <input type="text" required />
                                        </div>
                                    </div>
                                    <div className="col-lg-6">
                                        <div className="checkout__input">
                                            <p>Email<span>*</span></p>
                                            <input type="email" required />
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div className="col-lg-4 col-md-6">
                                <div className="checkout__order">
                                    <h4>Your Order</h4>
                                    <div className="checkout__order__products">
                                        Products <span>Total</span>
                                    </div>
                                    <ul>
                                        {cart.map((item, index) => (
                                            <li key={index}>
                                                {item.title}{" "}
                                                <span>
                                                    $
                                                    {(
                                                        item.price * item.quantity
                                                    ).toFixed(2)}
                                                </span>
                                            </li>
                                        ))}
                                    </ul>
                                    <div className="checkout__order__subtotal">
                                        Subtotal <span>${subtotal.toFixed(2)}</span>
                                    </div>
                                    <div className="checkout__order__total">
                                        Total <span>${subtotal.toFixed(2)}</span>
                                    </div>
                                    <div className="checkout__input__checkbox">
                                        <label htmlFor="payment">
                                            Check Payment
                                            <input
                                                type="checkbox"
                                                id="payment"
                                                onChange={handlePaymentChange}
                                                checked={selectedPaymentMethod === "payment"}
                                            />
                                            <span className="checkmark" />
                                        </label>
                                    </div>
                                    <div className="checkout__input__checkbox">
                                        <label htmlFor="paypal">
                                            PayPal
                                            <input
                                                type="checkbox"
                                                id="paypal"
                                                onChange={handlePaymentChange}
                                                checked={selectedPaymentMethod === "paypal"}
                                            />
                                            <span className="checkmark" />
                                        </label>
                                    </div>
                                    <button type="submit" className="site-btn">
                                        PLACE ORDER
                                    </button>
                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </section>
    );
};
